INSERT INTO `question_bank` (`id`, `game_category_id`, `question`, `instruction`, `choices`, `created_at`, `updated_at`) VALUES
(1, 4, 'Goals - difference', 'Bet on the goal difference between two teams. Example: 1-2 or 2-1 score means goal difference of 1. Choices: 0-10\r\nScore differences of 10 or higher would be counted as 10 ', '0-10', NULL, NULL),
(2, 4, 'Goals - match total', 'Bet on the total number of goals both home and away team will score. Choices: 0-20. Goals scored higher than 20 would be counted as 20', '0-20', NULL, NULL),
(3, 4, 'Goals - home team', 'Bet on the number of goals home team will score. Choices: 0-10. Goals scored higher than 10 would be counted as 10', '0-10', NULL, NULL),
(4, 4, 'Goals - away team', 'Bet on the number of goals away team will score. Choices: 0-10. Goals scored higher than 10 would be counted as 10', '0-10', NULL, NULL),
(5, 4, 'Shots - match total', 'Bet on the last digit of total number of shots (total). Choices: 0-9', '0-9', NULL, NULL),
(6, 4, 'Shots - home team', 'Bet on the last digit of total number of shots (home). Choices: 0-9', '0-9', NULL, NULL),
(7, 4, 'Shots - away team', 'Bet on the last digit of total number of shots (away). Choices: 0-9', '0-9', NULL, NULL),
(8, 4, 'Shots on target - match total', 'Bet on the total number of shots on target both home and away team will make. Choices: 0-50. shots on target made higher than 50 would be counted as 50', '0-9', NULL, NULL),
(9, 4, 'Shots on target - home team', 'Bet on the number of shots on target home team will make. Choices: 0-25. shots on target made higher than 25 would be counted as 25', '0-9', NULL, NULL),
(10, 4, 'Shots on target - away team', 'Bet on the number of shots on target away team will make. Choices: 0-25. shots on target made higher than 25 would be counted as 25', '0-9', NULL, NULL),
(11, 4, 'Corners - match total', 'Bet on the total number of corners both home and away team will be awarded. Choices: 0-20. Corners awarded higher than 20 would be counted as 20', '0-20', NULL, NULL),
(12, 4, 'Corners  - home team', 'Bet on the number of corners home team will be awarded. Choices: 0-10. Corners awarded higher than 10 would be counted as 10', '0-10', NULL, NULL),
(13, 4, 'Corners  - away team', 'Bet on the number of corners away team will be awarded. Choices: 0-10. Corners awarded higher than 10 would be counted as 10', '0-10', NULL, NULL),
(14, 4, 'Bookings - No. of yellow cards', 'Bet on the number of yellow cards that will be handed out in the whole game. Choices: 0-5. More than 5 yellow cards handed out will be counted as 5', '0-5', NULL, NULL),
(15, 4, 'Bookings - No. of red cards', 'Bet on the number of red cards that will be handed out in the whole game. Choices: 0-5. More than 5 red cards handed out will be counted as 5', '0-5', NULL, NULL),
(16, 4, 'Bookings - total no. of cards', 'Bet on the total number of cards that will be handed out in the whole game. Choices: 0-10. More than 10 cards handed out will be counted as 10', '0-10', NULL, NULL),
(17, 4, 'Penalties - match total', 'Bet on the number of penalties that will be awarded in the whole game. Choices: 0-4. More than 4 penalties awarded will be counted as 4', '0-4', NULL, NULL),
(18, 4, 'Time in Minutes - first goal', 'Bet on last digit of first goal minute. Choices: 0-9', '0-9', NULL, NULL),
