(20, 4, 'Time in Minutes - first substitution', 'Bet on last digit of first substitution minute. Choices: 0-9', '0-9', NULL, NULL),
(21, 4, 'Number of players to score (unique goal scorers)', 'Bet on how many unique players will score in a game. Choices: 1-8. More than 8 unique scores will be counted as 8', '1-8', NULL, NULL),
