(27, 5, 'Point difference - Q1', 'Bet on the score difference between two teams for Q1. Example: 30-25 or 25-30 means goal difference of 5. Choices: 0-10\r\nScore differences of 10 or higher would be counted as 10', '0-10', NULL, NULL),
(28, 5, 'Point difference - Q2', 'Bet on the score difference between two teams for Q1. Example: 30-25 or 25-30 means goal difference of 5. Choices: 0-10\r\nScore differences of 10 or higher would be counted as 10', '0-10', NULL, NULL),
(29, 5, 'Point difference - Q3', 'Bet on the score difference between two teams for Q1. Example: 30-25 or 25-30 means goal difference of 5. Choices: 0-10\r\nScore differences of 10 or higher would be counted as 10', '0-10', NULL, NULL),
